import logo from './logo.svg';
import './App.css';
import React from "react";

function App() {
  return (
    <div className="App">
      <div className="content">
          <h1>Hello World</h1>
      </div>
    </div>
  );
}

class Data extends React.Component() {
    constructor(props) {
        super(props);
        const table = new Object();

    }
    render() {
        return (
            props.forEach( (row) => {
                <tr>
                    <td>row.EmplId</td>
                    <td>row.EmplId</td>
                    <td>row.EmplId</td>
                    <td>row.EmplId</td>
                </tr>
            })
        )
    }
}


export default App;
